import { useEffect, useState } from 'react';
import './Select.css'

function Select({text = 'vide', className, id, idParent}) {
    return(
        <div class="accordion-item">
            <h2 class="accordion-header">
            <button class="accordion-button accordion-custom-header" type="button" data-bs-toggle="collapse" data-bs-target={ '#' + id} aria-expanded="true" aria-controls={id}>
                {text}
            </button>
            </h2>
            <div id={id} class="accordion-collapse collapse show" data-bs-parent={'#' + idParent}>
            <div class="accordion-body accordion-custom-body">
                <a>Lien</a>
            </div>
            </div>
        </div>
    )
}

export default Select;
